window.onload = function () {
    if($('.rellax').length > 0){
	    var rellax = new Rellax('.rellax', {
		    center: true,
	    });
    }
	$('body').append('<script src="/wp-content/themes/landing/assets/vendors/smoothScroll.js"></script>');
	var headerPosition =  $('.header-container').offset();
	var megamenuPosition =  $('.megamenu-wrap').offset();
	$('.megamenu').css('left', headerPosition.left - megamenuPosition.left + 'px');
};

AOS.init({
    once: true
});

(function ($) {



    var $ = jQuery;
    var api_url = 'https://stylemixthemes.scdn2.secure.raxcdn.com/api/prices.json';

    $.ajax({
        url: api_url,
        dataType: 'json',
        context: this,
        complete: function (data) {
            var r = data.responseJSON;
            $('.stm_price_api').text(r.themes.masterstudy.price);
        }
    });

    $(document).ready(function () {

	    var $youtube = $('#youtubeTutorialWrapFancy');
	    var $iframe = $youtube.find('iframe');
	    var youtube_url = $youtube.attr('data-youtube');
	    var $play = $('.video-play');

	    $play.on('click', function (e) {
		    e.preventDefault();

		    $youtube.addClass('tutorialVideoShow');
		    $iframe.attr('src', youtube_url);

	    });

	    $('.explainer_video').on('click', function (e) {
		    e.preventDefault();
		    $play.click();
	    });

	    $youtube.on('click', function () {
		    $youtube.removeClass('tutorialVideoShow');
		    $iframe.attr('src', '');
	    });

	    setTimeout(function(){
		    $('.book-1, .book-2, .book-3, .book-4, .man-5, .pencil, .laptop, .phone, .man-6, .man-2, .man-1, .man-3, .lamp, .stairs, .fade-shadow').addClass('animated');
        }, 2000);
	    $('.burger').on('click', function () {
           $(this).toggleClass('active');
           $(this).parent().find('.navigation').toggleClass('open');
           $('body').toggleClass('open-nav');
	    });
        $(document).on('click', 'a[href^="#"]', function (event) {
            event.preventDefault();
            $('html, body').animate({
                scrollTop: $($.attr(this, 'href')).offset().top
            }, 500);
        });


        var $imgs = $('.image-carousel img');
        var $images_carousel = $('.image-carousel');
        var $screenshots = $('.screen-wrap');



        $('.text-carousel').flickity({
            sync: '.image-carousel',
            lazyLoad: 1,
            prevNextButtons: false,
            sync: '.image-carousel'
            // asNavFor: '.image-carousel',
        });

        $images_carousel.flickity({
            lazyLoad: 1,
            prevNextButtons: false,
            // asNavFor: '.text-carousel',
            groupCells: 1,
            pageDots: false,
            autoPlay: true,
            pauseAutoPlayOnHover: true
        });

        if($screenshots.length > 0){
	        $screenshots.each(function () {
		        $(this).owlCarousel({
			        nav: true,
			        items: 1,
			        dots: true
		        });
	        });
        }

        $('.text-carousel').on('dragEnd.flickity', function () {
            $('.carousel__item.is-selected').addClass('ended');
        });

        $('.text-carousel').on('dragStart.flickity', function () {
            $('.carousel__item.ended').removeClass('ended');
        });

    });

})(jQuery);